,'[\"french\"]',30.00,NULL,'CHF','I\'m m3',1,0,0.00,0,'$2a$10$LXN/bJXEwh.7n6g8xBdCnu8HrQtUgNMxkR4HUDhHLR3QV8ar0tyOG','avacadava@gmail.com',NULL,'973349d546634ab2fd48e590ceba2c4c1a85850f25b97e2bbd3c417acf0158e80c4db53a3913674b1476c2d6d6bda0ac0014c2e7f23d2531e4768fdcf19623d2',NULL,'both',NULL,NULL,NULL),(19,'Justine Laura Cuendet','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/9d6a9db0-f72a-4084-8941-07d96c013157.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/b763e581-11f8-4712-bea2-6c89214f8c5b.png\"}','[\"psychology\",\"germanLesson\",\"frenchLesson\"]','[\"english\",\"french\",\"german\"]',47.00,'acct_1CS1IWLQsphykHOQ','CHF','French below\r\n\r\nI am teaching since long ( 10 years)  in the public and private schools and i also worked with  compagnies as FLE teacher. \r\n\r\nI can provide lessons in the following field : psychology with a specialisation in cognitive therapy ,  german language (grammar and discussion for beginner ) and French FLE  ( conversation) or school French ( reading, grammar, verbs)\r\n\r\nI speak french , german and english. \r\n\r\ni would be pleased to help you.\r\n\r\nEnseignante dans les écoles publiques ainsi que privées avec 10 ans d\'expérience ainsi que dans des entreprises privées pour l\'enseignement du français langue étrangère FLE. \r\nJe donne des cours dans les domaines suivants: psychologie avec une spécilaisation pour la thérapie cognitivo comportementale, l\'allemand scolaire: grammaire, conversation  ainsi que le français : lecture, grammaire, conversation. \r\n\r\nJe me ferais un plaisir de pouvoir vous aider.',1,0,0.00,0,'$2a$10$.DHNK/xmVAfrSs7BfqMRo.lJ9FlKyA0ZHOOAqsl8f31RMnN0e/iUa','justinelaura.cuendet@gmail.com',1,NULL,NULL,'both',NULL,NULL,NULL),(21,'Alessia De Marco','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/9ce53294-2882-4cf6-b662-a275cc41614f.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/c9be348a-6085-4757-83f