l.com',1,NULL,NULL,'both',NULL,NULL,NULL),(45,'James Daniels','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/343fb7a5-1c26-4bf0-b0a9-cfc1e7ccc706.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/e70747d9-7103-449a-a448-3d400eb1fb30.png\"}','[\"physics\"]','[\"english\"]',30.00,NULL,'EUR','I\'m an experienced physics teacher (qualified in 2003) who has been teaching physics to UK \"A\" level.\r\nPhysics is simultaneously one of the harder subjects to learn and one of the easiest. This is because one\'s ability to do it rests on mastery of its concepts. If I were to teach you some facts today and test you tomorrow, you\'d score highly because you\'d remember the facts. If I were to teach you a concept today and test you tomorrow, you\'d say, \"I was taught that yesterday, but I haven\'t got my head around it yet\". That\'s what makes physics difficult. However, once you\'ve got your head around the concept, then the subject becomes easy.\r\nI am focused on teaching the concepts of the subject and providing my students with a good workmanlike ability to apply them to problems.',1,0,0.00,0,'$2a$10$34YpmSuLoudgfkjRQybWE.SnRWhc7jk0KQ3h8dEbyfNOD1MZXD5Bu','james_daniels_belfast@hotmail.com',1,NULL,NULL,'both',NULL,NULL,NULL),(46,'Maino Sandra','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/44357fa1-08c7-47a8-a1c8-2e383cee0028.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/7e7544f4-a917-49db-bdf6-ba278306d5ee.png\"}','[\"frenchLesson\",\"italianLesson\",\"secondaryEducation\"]','[\"french\",\"italian\"]',39.00,NULL,'CHF','Enseignante spécialisée, éducatrice spécialisée ainsi qu\' animatrice de groupes de jeux en forêt,  je propose des cours dans le domaine de l’enseignement primaire et secondaire (ordinaire et spécialisé) ainsi que des cours d\'italien et de français. Si vous souhaitez une autre matière en rapport avec l\'éducation et l\'enseignement (ordinaire et spécialisé), n\'hésitez pas à me contacter.\r\n\r\nPossibilité de donner les cours en français, italien et (espagnol).',1,0,0.00,0,'$2a$10$70a6whIw5TkR27ryMJX8vOOywMJueenbLJkxEkRthynKJzex0K7wy','maino.sandra@gmail.com',1,NULL,NULL,'both',NULL,NULL,NULL),(47,'Rebeka Mali','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/9d2d7845-9d9c-47dd-b493-ff0ffd5dfd62.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/b913ac7c-d7bc-45bc-a740-e39b4736ddb3.png\"}','[\"englishLesson\",\"frenchLesson\",\"italianLesson\"]','[\"italian\",\"french\",\"english\"]',30.00,NULL,'EUR','Hi everyone!\r\n\r\nMy name is Rebeka and I\'m 20. I study at the University of Geneva. I\'m at the faculty of Translation and Interpreting. I\'m cheerful and I really want to help people with languages by transmitting my passion.\r\nI have Hungarian origins but I have lived in Italy for 15 years. \r\nI earned a C1 in English and I currently speak French. \r\n\r\nHope to hear from you soon!',1,0,0.00,0,'$2a$10$CF3MWZN9ITEemsNMK2rsgen11sorxxWVZy4bb5x12nwZw7GEU2cU6','rebeka.mali@etu.unige.ch',1,NULL,NULL,'both',NULL,NULL,NULL),(48,'Stuart Abram','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/cbd7b5a1-402b-41b4-96db-a5cd9ff74600.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/3bedfde8-04b1-4953-88b1-e8cadf7555a8.png\"}','[\"englishLesson\",\"englishLiterature\",\"frenchLesson\",\"spanishLesson\",\"italianLesson\"]','[\"english\"]',25.00,'acct_1CdQADFGEj5HhoNe','EUR','I am a first-class tutor, with first-class experience and an outstanding education.  Having studied at the Universities of Oxford and Durham, as well as in the Royal English College, Valladolid, Spain, I am well-acquainted with the very best of what has been thought and said and with the high tradition of knowledge.  I am also a gifted, patient and versatile tutor, able to help tutees experience remarkable and sustained progress in their studies.  \n\nIf you wish to be the best, then please get in touch and let the journey begin!',1,0,0.00,0,'$2a$10$ag.mX.PMAK.MyVt.sTRreOCROmZoFt2AVHb/3pfyPu/PDSoX6L/vK','stuart.abram@oxon.org',1,NULL,NULL,'both',NULL,NULL,NULL),(49,'Dr. Anthony Lok','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/2b3c17e0-77cb-4838-a8cc-15a73177c7f2.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/5586cb34-c13b-4d90-b676-0dd251b7d18e.png\"}','[\"businessManagement\"]','[\"english\"]',25.00,NULL,'USD','University teaching at postgrad level in my capacity as Visiting Fellow has been my 2nd career in the past 15 years. Apart from teaching general subjects in business administration, my special interest are in Principles of Management, Human Resources Management, Organisation Behaviour & Development, and Strategic Management.',1,0,0.00,0,'$2a$10$asqI1LgvTfQ4TG.3hC1nsupMjCALospnqJDHIQlOklczk8.5Qs7.2','anthony.lok@polyu.edu.hk',1,NULL,NULL,'both',NULL,NULL,NULL),(50,'Eriko Lehmann','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/8b8a9b81-5a4e-4bc8-aff4-34ed00912157.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/f1957f60-2714-49e4-8205-33ed7b8fd3eb.png\"}','[\"japaneseLesson\"]','[\"english\",\"french\",\"japanese\"]',50.00,NULL,'CHF','Bonjour\r\nJe suis originaire du Japonais originaire d\'Hiroshima au Japon.\r\nJe donne des cours pour débutants et niveau intermédiaire.\r\n\r\n- L\'écriture comprend l\'apprentissage des lettres japonaises telles que le hiragana, le katakana.\r\nGrammaire. Afin d\'avoir une conversation simple.\r\n\r\nJe suis également spécialisé dans l\'art à l\'université au Japon. Je peux donner une large connaissance de la culture japonaise.',1,0,0.00,0,'$2a$10$weFmhNNSiSiBWTgGxpywD.7ZwzQHSVpHQDcnhm19pSnLJ.Z7k2IEK','erikomaedalehmann@gmail.com',1,NULL,NULL,'both',NULL,NULL,NULL),(52,'Lyubomira Nikolova','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/08f239bd-9005-4883-80da-57da0b