cher.\r\nHope to see y\'all so soon!\r\nHasta luego!!\r\n\r\nThis is the list of price for different duration classes: \r\n30 min 7 USD\r\n45 min 11 USD \r\n60 min 14 USD \r\n90 min 26 USD',1,0,0.00,0,'$2a$10$T9CoM3ezsAdLMBnD7cwsPurbQFHjyufv6EOR.hWJyIoO8ug8A56Zu','nicksinescoger@hotmail.com',1,NULL,'nicksinescoger@hotmail.com','both',0,'en',0),(326,'Cesar Isaac Pacas Chiluisa','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/2346cb8a-8b49-463c-82c9-dbe042f07094.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/4341a2ba-e61d-45bc-834e-f87bfd3c23aa.png\"}','[\"englishLesson\",\"spanishLesson\"]','[\"english\",\"spanish\"]',7.00,NULL,'USD','Un cordial saludo. Me llamo Isaac, soy una persona muy dinámica, atenta, responsable y de trabajo arduo. Me encantan los idiomas especialmente el español y el Inglés, por lo cual, me encanta poder enseñar estos dos idiomas al mundo. Realmente espero tener a muchos de ustedes que deseen aprender cualquiera de estos idiomas con mi ayuda, que lo haremos de una manera muy eficaz.\n\nReceive a warm greeting. My name is Isaac, I am a very dynamic, attentive, responsible and hard-working person. I love languages especially Spanish and English. For that reason, I love teaching these two languages to the world. I really hope to have many of you who wish to learn any of these languages with my help, and  we will do it in a very effective way.',1,0,0.00,0,'$2a$10$WYJjw4HJjJD./gh5ByreFeeE/8Y8C/Q3njlDExR7w7X9AiVfogAAi','isaacpacas@gmail.com',1,NULL,'isaacpacas@gmail.com','both',0,'en',0),(327,'Cruz Maria','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/7f3f5352-f7a9-4aea-8a89-0ce0f096f5aa.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/55e516cb-d9b4-4d00-b006-2a98ec7960d9.png\"}','[\"spanishLesson\"]','[\"spanish\"]',10.00,NULL,'EUR','Hola, me llamo Cruz y soy profesora de español para extranjeros con más de 22 años de experiencia. Estoy acreditada para preparar el examen DELE de todos los niveles.',1,0,0.00,0,'$2a$10$2d29VLhY3sQYwY87VW2dXO3VbPqvaZqqddcstIUJt7.QydQlHZe5K','cruzhb@gmail.com',1,NULL,'cruzhb@gmail.com','both',0,'en',0),(328,'María del Alba Orellana','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/4644792d-af0f-4b60-8332-676db2dd985f.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/26a5b2bf-fde1-457c-9d88-6765a1a6d6b0.png\"}','[\"artHistory\"]','[\"spanish\"]',12.00,NULL,'USD','Soy Lic. en Gestión e Historia de las Artes (Universidad del Salvador) He cursado también el Ciclo Pedagógico Universitario, lo cual me ha brindado las herramientas necesarias para poder dar clase, lo cual disfruto muchísimo.\nAl mismo tiempo, me encuentro preparando mi tesis de una Maestría en Estudios Internacionales\nMis clases dependen de cuáles son los intereses del alumno. Me gusta comenzar utilizando alguna obra de arte como disparador del cual derivaré hacia otros temas que estén relacionados. Ellos pueden ser filosóficos, históricos, mitológicos o artísticos. Suelo usar imágenes y presentaciones de Powerpoint para mayor claridad del alumno.',1,0,0.00,0,'$2a$10$Mpc8c9xedcAbd4pyIaOtPO8cByeJ3/nzzlNQGOULabo6aO5V8A/D.','alba.orellana91@gmail.com',1,NULL,NULL,'both',0,'en',0),(329,'Carina','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/b8cc9b86-40b6-4f55-ab31-3cf2e6e4fb22.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/95fb72a9-21cb-43b5-9bc4-6cd43bdf608d.png\"}','[\"coaching\"]','[\"dutch\"]',14.00,NULL,'EUR','I try to make my online lessons as cosy as possible. I use the video-conference system, so I can see my students and they can see me; we can talk, we make the exercises together, I explain all the grammar, and if my students have any doubt or questions, I explain it orally which I think makes it easier to be understood.\nIt is as if we were sitting in an office side by side. The only thing we cannot do is drinking a coffee while we study.\nBesides the lessons, I always send some homework. I will send a book that we follow, and the rest of the material is sent by me by e-mail as well.\nAs soon as it is possible, I advise my students to start reading books in the language they learn, and from the very beginning to start listening to the TV. It is a way of being surrounded by the language.\nI always insist a lot on the accent, and this helps. I have students with a perfect accent. Listening to the language also helps to open the hears to the sounds, making easier to understand. From the very beginning I also start with small conversations in each lesson.\nYou may believe that all my students are being very successful with this kind of lessons. I have now students from all over the world. Concerning the level my students attain, ofcourse it depends on them.\nTogether we see what your needs are and how fast you want to learn.\nAs for the number of lessons per week, I advise that you should have at least two. Less than two is very little and you have a long break between lessons. It is bad because you don\'t have any contact with the language and feel that you are advancing very slowly.\nI am a qualificated teacher in Dutch language and have been teaching for more than 20 years at school and online, groups as well as lessons.',1,0,0.00,0,'$2a$10$PQr9gDPm1tMoqi102lb2Su.dwpZ..EUwJj2Dp5a9a4/AJDpjDeY76','lillenorge@live.be',NULL,'8ac1febd81f638cd63c5434c7e8dda2a43f4bdab36ce61023d5484e4f0d777b59d12ee89a5119b93c8c82c7fe28ef17cff750fca3b06a203381957b566a4c26a',NULL,'both',0,'en',0),(330,'Adrian Taranzano','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/39b69141-b500-47e7-9730-fc0aa2c37053.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/448af165-1863-426a-ad0a-860c15ab83c1.png\"}','[\"germanLesson\",\"italianLesson\",\"spanishLesson\"]','[\"italian\",\"spanish\"]',12.00,NULL,'USD','Let\'s learn together!',1,0,0.00,0,'$2a$10$zkRWvLtgyquFCZdJr5DQF.u