sed in nature, geography and ethnography.\n\nWorking professionally since 2010, and a with a long career as a salesman along all my life.',1,0,0.00,0,'$2a$10$PC9EwKARfSLWBEuwGB0KJuG0GcwCIkyB2loYqu4zGsT..C6ImiGMi','almerianature@mailbox.org',1,NULL,'indalodeoz@gmail.com','both',0,'en',0),(338,'Ludo Pollers','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/5082582b-0d92-41e7-bd22-0f467469de6b.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/44d6e026-95fc-4d5d-806b-f5253343db30.png\"}','[\"psychology\"]','[\"english\",\"dutch\"]',10.00,NULL,'EUR','Hi,\n\nNeed help with your psychology course/EE?\nLet\'s get started!\nLP',1,0,0.00,0,'$2a$10$TwQAaNDal/M4cizrIE51OO7iyFpU1rYvJUqupa7bGSQgL/CZHvkt6','lpollers@gmail.com',1,NULL,'lpollers@gmail.com','both',0,'en',0),(339,'Rico','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/84b9efb2-9a19-4bc4-b6d0-2d0924865ce2.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/dc1668d0-7adb-4116-a531-fdc6004c434f.png\"}','[\"frenchLesson\",\"englishLesson\"]','[\"dutch\"]',18.00,NULL,'EUR','Teaching Dutch, French & English.',1,0,0.00,0,'$2a$10$ptrK4zRcLYhDoSeAupBgrugwg2H9RWGCbSHsC.At/SFpKnmh2.PnW','rico.devos@telenet.be',NULL,'2e0c6f13a9ba2cabd2035a4f2a2caf1a6c70ad9059a5fa1dc85f88825fb2151634503ea75764ee4e95fba164bfb2b0062798672728880598bc77ac164237a250',NULL,'both',0,'en',0),(340,'Felix Brassier','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/966de887-b430-4fa6-8b19-2bd85eb56fe1.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/b208d7b7-d4d6-4c43-a7cb-19124a853ef3.png\"}','[\"frenchLesson\",\"englishLesson\"]','[\"english\",\"arabic\",\"french\",\"italian\"]',17.00,NULL,'USD','About Me\nI\'m Felix, a French filmmaker/digital artist/language teacher and humanitarian worker.\nI Love people and even more talking with them, this is how I became polyglot and I now use this knowledge to help learners from all over the world to do the same.\n\nMe as a Teacher\nI started teaching on the field as a humanitarian worker.\nFrom an emergency and chaotic situation, where everything had to be done quickly etc ... I grew up, I experienced many different teaching experiences and I improved my skills (passing formation and certificates such as TOEFL and FLE etc ...) to be an official and professional teacher.\n\nMy Lessons & Teaching Style\nI try to share the fun of speaking languages the more I can in my lessons.\nMy lessons are essentially based on lively conversations and topic based activities putting the student in a position where he can learn and practice the language in a useful and efficient way. \nFor any languages, I tend to focus on the spoken language, the one used in real life.\n\nTeaching Material\nPDF file\nText Documents\nAudio files\nImage files\nVideo files',1,0,0.00,0,'$2a$10$./qZE.NnwfyTsiI6ENN4lezOv/0oKYJ8YctNPlk/be3IZ4BZaltN2','felix.brassier@gmail.com',1,NULL,'felix.brassier@gmail.com','both',0,'en',0),(341,'Francesca Di Biase','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/69659160-d718-456b-a3d3-59e4e883c741.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/8c4bb15f-7410-41bb-82db-b0c44b98cc35.png\"}','[\"italianLesson\"]','[\"italian\"]',7.00,NULL,'EUR','Good morning everyone! \nI am Francesca. Italian is my mother tongue.\nI would like to help you understand my beautiful language in the best way possible by having a lot of conversation with me. \nI have a true passion for my tutoring job, I teach the Italian language to foreign students of all ages and levels, this is a job that I have been doing online during the last few years.\n like travelling, reading and keeping  myself constantly up to date through online courses of languages, communication skills and teacher training.\nI have a diploma in foreign languages so I can help students who need  a tutor with a good knowledge of English and Spanish.I am a cheerful, open  and patient person  and I would like to put my enthusiasm and my professionalism  at the disposal of all the people who want to learn or improve their knowledge of Italian language.\n I like to personalize my conversations based on the person in front of me and his needs, without ever forgetting  to have fun. Understanding the difficulty of studying a foreign language, I try to put my students at ease so that they feel as relaxed as possible, just as if they were chatting with a friend.  My TEACHING METHOD  is based on a full hour of conversation in which I propose, dictations, readings, role plays, educational activities together with grammar exercises. I am available to assign tasks at the end of the lesson so that students can continue to remain in constant exercise. Tasks will be returned correctly during the next lesson or via email.',1,0,0.00,0,'$2a$10$EMmuS6.N9kfwTpxroYPxPu10kS.8rdyVnpAmUce0gK1JXALYuvuHq','francesca.dibiase1971@gmail.com',1,NULL,'francesca.dibiase1971@gmail.com','both',0,'en',0),(342,'Francesca di biase','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/4f3f169b-e512-4c22-8261-87426cb52b2b.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/50985c81-2708-4d78-b29d-b341fc89c80b.png\"}','[]','[]',NULL,NULL,'USD',NULL,0,0,0.00,0,'$2a$10$RI6XpIJSFgCasn.uzzYXiuz.o6fia554cOd4a2KQYI3Aw3xJEY2uS','francesca.dibiase71@gmail.com',NULL,'ea1789997b30fa9a4466e396fa01e6b83832f802b0dcb8aaf1a53c8d69980cfc6a4d9a97b84144863a6e2f9fb159fc9fdb42c5264bfeb1354789ca65efff451c',NULL,'both',0,'en',0),(343,'Diana Vallejo','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/02fb29e1-6b6b-49ee-b912-d48fa27decbe.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/fbe9e54d-f456-43a4-ab07-5fc79d21d5bd.png\"}','[\"artsHumanities\"]','[\"spanish\"]',7.00,NULL,'USD','Poeta, viajera, y defensora dela vida.',1,0,0.00,0,'$2a$10$WVLpnX.KexsUVd40hfDH9efyZ4F.hHXbfad0tL0GmhY31G5UUImRG','