ät München), Innovación estratégica (Vanderbilt University), y Creatividad (University of Pennsylvania). Premios Editorial El Derecho, Dr. Rodolfo E. Moltedo, Banco Sudameris y Consorcio Petrolero Total Austral, entre otros. \n\nDoctorando en Administración de Negocios por ESEADE 2018.',1,0,0.00,0,'$2a$10$thm1pKVO1YxTpTvskVblAORb8GvUfXcVPLvnKVvD3js8xL9DJUYWK','albaperezromero@gmail.com',1,NULL,NULL,'both',0,'en',0),(345,'ranjana saini','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/d15c4a6c-dcff-4bd4-b5e8-55739f72e36b.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/7cd1db8e-4fdb-45de-a30c-25efac6c00b7.png\"}','[\"englishLesson\",\"microbiology\",\"teacherTraining\",\"biology\"]','[\"english\",\"hindi\"]',6.00,NULL,'USD','i am basically a medical student of 5th course.As an after-school tutor,my main responsibility is to help students learn, reviewing content with them, explaining how to solve problems and checking completed work. i am ready to help students develop study skills and organization techniques to help improve their academic performance.',1,0,0.00,0,'$2a$10$2TeHMoK5VR3y20FjDaJFT.OFi7ooWqprQTWk7yvWVdMZi9UzWKC8m','ranjanabutterfly1695@icloud.com',1,NULL,'ranjanabutterfly1695@icloud.com','both',0,'en',0),(346,'tffgv','{\"preview\":\"https://brainvicinity.com/api/files/uploads/temporary/6cb9c17b-c14a-4d63-b072-c94a93662e9c.png\",\"original\":\"https://brainvicinity.com/api/files/uploads/temporary/e757a51b-e701-4e53-a876-56ce92b3a53a.png\"}','[]','[]',NULL,NULL,'USD',NULL,0,0,0.00,0,'$2a$10$vtVB2MOqyPn9LLCovQbP7eLi3DN1/J3yB9.MOuBPri5FRhUKIctk.','ranjanasaini1695@icloud.com',NULL,'55f6a59604baf169af1d43858738c6fa90e108b1b2873e067683e727650ae5985e0e3785e8c668b278aa901ab8691e3e050d36f921294f7661b2b9d696fd6266',NULL,'both',0,'en',0);
